import MuiDialog from "@material-ui/core/Dialog";

const styles = {
  "MuiDialog-Paper": {
    width: 600,
    height: 318,
  },
};

export default function Dialog({ isOpen, onClose }) {
  return (
    <MuiDialog open={isOpen} style={styles["MuiDialog-Paper"]}>
      Dialog
      <button onClick={onClose}>Close</button>
    </MuiDialog>
  );
}
